INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 7, 1, "2015/12/17 15:00:00", -363.0, "キャル", 0.0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 7001, 0, 0.0, 106001, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 7, 1, "2015/12/17 15:00:00", -363.0, "コッコロ", 0.0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 7002, 0, 0.0, 105901, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 7, 1, "2015/12/17 15:00:00", -363.0, "ペコリーヌ", 0.0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 7003, 0, 0.0, 105801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 10, 1, "2015/12/17 15:00:00", -363.0, "ペコリーヌ", 0.0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 10001, 0, 0.0, 105801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 10, 1, "2015/12/17 15:00:00", -363.0, "キャル", 0.0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 10002, 0, 0.0, 106001, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 10, 1, "2015/12/17 15:00:00", -363.0, "コッコロ", 0.0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 10003, 0, 0.0, 105901, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 10, 2, "2015/12/17 15:00:00", -363.0, "シェフィ", 0.0, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 10004, 0, 0.0, 106401, 2104010);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 12, 1, "2015/12/17 15:00:00", -416.5, "ペコリーヌ", 0.0, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 12001, 0, 0.0, 105801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 13, 1, "2015/12/17 15:00:00", -363.0, "キャル", 0.0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 13001, 0, 0.0, 106001, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 13, 1, "2015/12/17 15:00:00", -363.0, "コッコロ", 0.0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 13002, 0, 0.0, 105901, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 13, 2, "2015/12/17 15:00:00", -363.0, "シェフィ", 0.0, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 13003, 0, 0.0, 106401, 2104010);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 13, 1, "2015/12/17 15:00:00", -363.0, "ペコリーヌ", 0.0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 13004, 0, 0.0, 105801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 14, 1, "2015/12/17 15:00:00", -363.0, "コッコロ", 0.0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 14001, 0, 0.0, 105901, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 14, 2, "2015/12/17 15:00:00", -363.0, "シェフィ", 0.0, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 14002, 0, 0.0, 106401, 2104010);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 14, 1, "2015/12/17 15:00:00", -363.0, "ペコリーヌ", 0.0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 14003, 0, 0.0, 105801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 14, 1, "2015/12/17 15:00:00", -363.0, "キャル", 0.0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 14004, 0, 0.0, 106001, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 15, 1, "2015/12/17 15:00:00", -470.0, "コッコロ", 0.0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 15001, 0, 0.0, 105901, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 16, 2, "2015/12/17 15:00:00", -363.0, "シェフィ", 0.0, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 16001, 0, 0.0, 106401, 2104010);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 16, 1, "2015/12/17 15:00:00", -363.0, "ペコリーヌ", 0.0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 16002, 0, 0.0, 105801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 16, 1, "2015/12/17 15:00:00", -363.0, "キャル", 0.0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 16003, 0, 0.0, 106001, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 16, 1, "2015/12/17 15:00:00", -363.0, "コッコロ", 0.0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 16004, 0, 0.0, 105901, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 17, 1, "2015/12/17 15:00:00", -363.0, "コッコロ", 0.0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 17002, 0, 0.0, 105901, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 25, 1, "2015/12/17 15:00:00", -363.0, "キャル", 0.0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 17004, 0, 0.0, 106001, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 25, 1, "2015/12/17 15:00:00", -363.0, "コッコロ", 0.0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 17005, 0, 0.0, 105901, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 25, 2, "2015/12/17 15:00:00", -363.0, "シェフィ", 0.0, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 17006, 0, 0.0, 106401, 2104010);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 25, 1, "2015/12/17 15:00:00", -363.0, "ペコリーヌ", 0.0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 17007, 0, 0.0, 105801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 18, 1, "2015/12/17 15:00:00", -363.0, "カリン", 0.0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 18001, 0, 0.0, 190801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 2, 18, 1, "2015/12/17 15:00:00", -363.0, "カリン", 0.0, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 18002, 0, 0.0, 190801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 3, 19, 1, "2015/12/17 15:00:00", -470.0, "カリン", 0.0, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 19001, 0, 0.0, 190801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 4, 19, 1, "2015/12/17 15:00:00", -470.0, "カリン", 0.0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 19002, 0, 0.0, 190801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 5, 20, 1, "2015/12/17 15:00:00", -470.0, "カリン", 0.0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 20001, 0, 0.0, 190801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 6, 20, 1, "2015/12/17 15:00:00", -470.0, "カリン", 0.0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 20002, 0, 0.0, 190801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 21, 1, "2015/12/17 15:00:00", -363.0, "キャル", 0.0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 21001, 0, 0.0, 106001, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 21, 1, "2015/12/17 15:00:00", -363.0, "コッコロ", 0.0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 21002, 0, 0.0, 105901, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 21, 2, "2015/12/17 15:00:00", -363.0, "シェフィ", 0.0, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 21003, 0, 0.0, 106401, 2104010);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 21, 1, "2015/12/17 15:00:00", -363.0, "ペコリーヌ", 0.0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 21004, 0, 0.0, 105801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 22, 1, "2015/12/17 15:00:00", -430.0, "カリン", 0.0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 22001, 0, 0.0, 190801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 2, 22, 1, "2015/12/17 15:00:00", -430.0, "カリン", 0.0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 22002, 0, 0.0, 190801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 3, 23, 1, "2015/12/17 15:00:00", -430.0, "カリン", 0.0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 23001, 0, 0.0, 190801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 4, 23, 1, "2015/12/17 15:00:00", -430.0, "カリン", 0.0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 23002, 0, 0.0, 190801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 2, 1, 24, 1, "2019/01/31 12:00:00", -385.0, "エリコ（バレンタイン）", 4.08, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 24001, 10011, 8.0, 109001, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 2, 2, 24, 1, "2019/01/31 12:00:00", -385.0, "エリコ（バレンタイン）", 5.0, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 24002, 10011, 8.0, 109001, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 2, 3, 24, 1, "2019/01/31 12:00:00", -385.0, "エリコ（バレンタイン）", 10.11, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 24003, 10011, 8.0, 109001, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 2, 4, 24, 1, "2019/01/31 12:00:00", -385.0, "エリコ（バレンタイン）", 4.0, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 24004, 10011, 8.0, 109001, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 2, 5, 24, 1, "2019/01/31 12:00:00", -385.0, "エリコ（バレンタイン）", 6.0, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 24005, 10011, 8.0, 109001, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 6, 24, 1, "2019/01/31 12:00:00", 0.0, "エリコ（バレンタイン）", 0.0, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 24006, 10011, 0.0, 109002, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 7, 24, 1, "2019/01/31 12:00:00", 0.0, "エリコ（バレンタイン）", 0.0, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 24007, 10011, 0.0, 109002, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 8, 24, 1, "2019/01/31 12:00:00", 0.0, "エリコ（バレンタイン）", 0.0, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 24008, 10011, 0.0, 109002, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 9, 24, 1, "2019/01/31 12:00:00", 0.0, "エリコ（バレンタイン）", 0.0, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 24009, 10011, 0.0, 109002, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 10, 24, 1, "2019/01/31 12:00:00", 0.0, "エリコ（バレンタイン）", 0.0, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 24010, 10011, 0.0, 109002, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 2, 1, 24, 1, "2019/01/31 12:00:00", -385.0, "シズル（バレンタイン）", 2.12, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 24011, 10011, 8.0, 109101, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 2, 2, 24, 5, "2019/01/31 12:00:00", -385.0, "シズル（バレンタイン）", 4.19, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 24012, 10011, 8.0, 109101, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 4, 3, 24, 2, "2019/01/31 12:00:00", -385.0, "シズル（バレンタイン）", 2.3, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 24013, 10011, 8.0, 109101, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 4, 24, 1, "2019/01/31 12:00:00", 0.0, "シズル（バレンタイン）", 0.0, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 24014, 10011, 0.0, 109102, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 2, 5, 24, 5, "2019/01/31 12:00:00", -385.0, "シズル（バレンタイン）", 5.23, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 24015, 10011, 8.0, 109101, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 6, 24, 1, "2019/01/31 12:00:00", 0.0, "シズル（バレンタイン）", 0.0, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 24016, 10011, 0.0, 109102, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 2, 7, 24, 1, "2019/01/31 12:00:00", -385.0, "シズル（バレンタイン）", 5.01, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 24017, 10011, 8.0, 109101, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 8, 24, 1, "2019/01/31 12:00:00", 0.0, "シズル（バレンタイン）", 0.0, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 24018, 10011, 0.0, 109102, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 9, 24, 1, "2019/01/31 12:00:00", 0.0, "シズル（バレンタイン）", 0.0, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 24019, 10011, 0.0, 109102, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 10, 24, 1, "2019/01/31 12:00:00", 0.0, "シズル（バレンタイン）", 0.0, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 24020, 10011, 0.0, 109102, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 26, 2, "2015/12/17 15:00:00", -363.0, "シェフィ", 0.0, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 26001, 0, 0.0, 106401, 2104010);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 26, 1, "2015/12/17 15:00:00", -363.0, "ペコリーヌ", 0.0, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 26002, 0, 0.0, 105801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 26, 1, "2015/12/17 15:00:00", -363.0, "キャル", 0.0, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 26003, 0, 0.0, 106001, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 26, 1, "2015/12/17 15:00:00", -363.0, "コッコロ", 0.0, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", 26004, 0, 0.0, 105901, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 27, 2, "2015/12/17 15:00:00", -363.0, "シェフィ", 0.0, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", 27001, 0, 0.0, 106401, 2104010);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 27, 1, "2015/12/17 15:00:00", -363.0, "ペコリーヌ", 0.0, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", 27002, 0, 0.0, 105801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 27, 1, "2015/12/17 15:00:00", -363.0, "キャル", 0.0, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", 27003, 0, 0.0, 106001, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 27, 1, "2015/12/17 15:00:00", -363.0, "コッコロ", 0.0, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", 27004, 0, 0.0, 105901, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 28, 1, "2019/09/24 15:00:00", -363.0, "カリン", 0.0, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", 28001, 0, 0.0, 190801, 0);
