INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 3, 29, 1, "2019/09/24 15:00:00", -409.0, "カリン", 0.0, "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！", 29001, 0, 0.0, 190801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 4, 29, 1, "2019/09/24 15:00:00", -409.0, "カリン", 0.0, "こちらの一覧で\nフレンドのプロフィールを\n確認できますよ", 29002, 0, 0.0, 190801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 5, 30, 1, "2019/09/24 15:00:00", -409.0, "カリン", 0.0, "フレンド管理は\nこちらになります\n新しいフレンドとの出会いを\n楽しんでくださいね！", 30001, 0, 0.0, 190801, 0);
