INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 7, 31, 1, "2019/10/31 12:00:00", -409.0, "カリン", 0.0, "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！", 31001, 0, 0.0, 190801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 8, 31, 1, "2019/10/31 12:00:00", -409.0, "カリン", 0.0, "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね", 31002, 0, 0.0, 190801, 0);
