INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2020/01/04 4:59:59", 1, 3, 33, 1, "2019/12/20 5:00:00", -409.0, "カリン", 0.0, "フレンドになって\n初心者の方を応援しましょう！\n素敵な報酬が待っていますよ！", 33001, 0, 0.0, 190801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2020/01/04 4:59:59", 1, 4, 33, 1, "2019/12/20 5:00:00", -409.0, "カリン", 0.0, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 33002, 0, 0.0, 190801, 0);
