INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2020/01/10 11:59:59", 1, 6, 34, 1, "2020/01/04 5:00:00", -409.0, "カリン", 0.0, "ミッション報酬の受け取りは\nこちら！\n受け取り漏れの無いように\n気を付けてくださいね！", 34002, 0, 0.0, 190801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 2, 1, 38, 1, "2015/12/17 15:00:00", -458.0, "ペコリーヌ", 5.3, "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪", 38001, 0, 0.0, 105801, 0);
