INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 41, 1, "2015/12/17 15:00:00", -363.0, "シェフィ", 0.0, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", 41001, 0, 0.0, 106401, 2104010);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 41, 1, "2015/12/17 15:00:00", -363.0, "ペコリーヌ", 0.0, "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！", 41002, 0, 0.0, 105801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 41, 1, "2015/12/17 15:00:00", -363.0, "キャル", 0.0, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", 41003, 0, 0.0, 106001, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 41, 1, "2015/12/17 15:00:00", -363.0, "コッコロ", 0.0, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", 41004, 0, 0.0, 105901, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 42, 1, "2015/12/17 15:00:00", -416.5, "コッコロ", 0.0, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", 42001, 0, 0.0, 105901, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 42, 1, "2015/12/17 15:00:00", -416.5, "シェフィ", 0.0, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", 42002, 0, 0.0, 106401, 2104010);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 42, 1, "2015/12/17 15:00:00", -416.5, "ペコリーヌ", 0.0, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", 42003, 0, 0.0, 105801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 42, 1, "2015/12/17 15:00:00", -416.5, "キャル", 0.0, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", 42004, 0, 0.0, 106001, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 43, 1, "2015/12/17 15:00:00", -363.0, "ペコリーヌ", 0.0, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", 43001, 0, 0.0, 105801, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 43, 1, "2015/12/17 15:00:00", -363.0, "コッコロ", 0.0, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 43002, 0, 0.0, 105901, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 43, 1, "2015/12/17 15:00:00", -363.0, "キャル", 0.0, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 43003, 0, 0.0, 106001, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 44, 1, "2015/12/17 15:00:00", -416.5, "アメス", 0.0, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 43004, 0, 0.0, 123001, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 2, 44, 1, "2015/12/17 15:00:00", -416.5, "アメス", 0.0, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 43005, 0, 0.0, 123001, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 2, 3, 45, 1, "2015/12/17 15:00:00", -416.5, "アメス", 5.79, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 43006, 0, 0.0, 123001, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 1, 1, 46, 1, "2015/12/17 15:00:00", -371.5, "アメス", 0.0, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 46001, 0, 0.0, 123001, 0);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES ("2030/12/17 14:59:59", 2, 1, 47, 2, "2015/12/17 15:00:00", -416.5, "シズル", 0.0, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", 47001, 0, 0.0, 104901, 0);
